{"operationName":"GetBoardIdeas","variables":{"first":15,"input":{"board_idx":"board_kvjnzqme","topic":[],"status":[],"sort":"DESC","sortBy":"trending","is_archived":false,"is_bug":false,"show_merged":false}},"query":"query GetBoardIdeas($input: BoardIdeasInput!, $first: Int = 20, $after: String) {
  boardIdeas(input: $input, first: $first, after: $after) {
    ...IdeaConnection
    __typename
  }
}

fragment IdeaConnection on IdeaConnection {
  pageInfo {
    ...PageInfo
    __typename
  }
  edges {
    node {
      ...IdeaPreview
      __typename
    }
    cursor
    __typename
  }
  __typename
}

fragment IdeaPreview on Idea {
  approval_status
  attachments {
    ...Attachment
    __typename
  }
  author {
    ...CompanyFollowerProfile
    __typename
  }
  board {
    idx
    slug
    __typename
  }
  comment_count
  cover_image
  created_at
  deleted
  excerpt
  idx
  is_archived
  is_pinned
  is_private
  name
  order
  priority_score
  priority_score_normalized
  show_in_roadmap
  slug
  status {
    color
    idx
    is_completed
    name
    __typename
  }
  topics {
    idx
    name
    __typename
  }
  updated_at
  vote_count
  vote_count_by_user
  __typename
}

fragment Attachment on Attachment {
  idx
  name
  url
  type
  created_at
  __typename
}

fragment CompanyFollowerProfile on CompanyFollower {
  avatar
  idx
  name
  roles
  __typename
}

fragment PageInfo on PageInfo {
  hasNextPage
  endCursor
  total
  count
  __typename
}"}
